import React from 'react'
import classes from './Footer.module.css'
export const Footer = () => {
  return (
    <footer className={classes}>
        <div className={classes["left-footer"]}>
            <h2>Alamat</h2>
            <span></span>
        </div>
    </footer>
  )
}
